import { Menubar } from 'primereact/menubar'; // Replace with TabMenu

const TopMenu = () =>
{
    const items = [
        {
            label: 'Home',
            icon: 'pi pi-home'
        },
        {
            label: 'Features',
            icon: 'pi pi-star'
        },
        {
            label: 'Projects',
            icon: 'pi pi-star',
        },
        {
            label: 'Contact',
            icon: 'pi pi-envelope'
        }
    ];
    return <Menubar model={items} />
}

export default TopMenu;
